import "./App.css";
import Footer from "./footer.js";
import Header from "./header.js";
import Panel from "./panel.js";
import Arows from "./arows.js";

function App() {
  return (
    <>
      <Arows />
      <Header />
      <Panel />
      <Footer />
    </>
  );
}

export default App;
